import {Link} from "react-router-dom";

function Tr_demandeProforma(props) {

    return (
        <tr className="">
        <td><Link to={'/proforma/'+props.demande.iddemande_proformat}>Demande proforma {props.demande.iddemande_proformat}</Link></td> 
            <td>{props.demande.date_demande}</td> 
            <td>{props.demande.date_livraison}</td> 
            <td>{props.demande.lieu_livraison}</td> 
        </tr>

    );
}

export default Tr_demandeProforma
